import React, { useState, useEffect } from 'react';

const RegistrationTable = () => {
  const [data, setData] = useState([]); // State to hold fetched data
  const [searchTerm, setSearchTerm] = useState(''); // State for search term
  const [loading, setLoading] = useState(false); // Loading state
  const [error, setError] = useState(null); // Error state
  const totalRows = 10; // Number of rows to display

  // Fetch data from the backend
  const fetchRegistration = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch('http://localhost:8080/registration/all'); // Update endpoint as needed
      if (!response.ok) {
        throw new Error(`Failed to fetch data: ${response.status} ${response.statusText}`);
      }
      const fetchedData = await response.json();
      setData(fetchedData);
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  // Fetch data when the component mounts
  useEffect(() => {
    fetchRegistration();
  }, []);

  // Filter data based on the search term
  const filteredData = data.filter((item) =>
    Object.values(item).some((value) =>
      value?.toString().toLowerCase().includes(searchTerm.toLowerCase())
    )
  );

  // Limit displayed rows to totalRows or the number of filtered items if less
  const rows = filteredData.slice(0, totalRows);
  const emptyRows = totalRows - rows.length;

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h2 style={styles.title}>Registration Data</h2>
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={styles.searchBar}
        />
      </div>

      {loading && <div style={styles.loading}>Loading data...</div>}
      {error && <div style={styles.error}>Error: {error}</div>}

      {!loading && !error && data.length > 0 ? (
        <table style={styles.table}>
          <thead>
            <tr>
              {Object.keys(data[0] || {}).map((key, index) => (
                <th key={index} style={styles.headerCell}>{key}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {rows.map((item, index) => (
              <tr
                key={index}
                style={{ backgroundColor: index % 2 === 0 ? '#ffffff' : '#f9f9f9' }}
              >
                {Object.keys(data[0] || {}).map((key, colIndex) => (
                  <td key={colIndex} style={styles.cell}>{item[key] || 'â€”'}</td>
                ))}
              </tr>
            ))}
            {emptyRows > 0 && (
              Array.from({ length: emptyRows }, (_, index) => (
                <tr key={`empty-row-${index}`} style={{ backgroundColor: '#ffffff' }}>
                  {Object.keys(data[0] || {}).map((_, colIndex) => (
                    <td key={colIndex} style={styles.cell}>&nbsp;</td>
                  ))}
                </tr>
              ))
            )}
          </tbody>
        </table>
      ) : (
        !loading && <div style={styles.noData}>No data available.</div>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: '5px',
    fontFamily: 'Arial, sans-serif',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '15px',
  },
  title: {
    margin: 0,
    fontSize: '24px',
    fontWeight: 'bold',
    color: '#333',
  },
  searchBar: {
    width: '200px',
    padding: '8px',
    border: '1px solid #ccc',
    borderRadius: '4px',
    fontSize: '16px',
  },
  loading: {
    fontSize: '18px',
    color: '#555',
  },
  error: {
    fontSize: '18px',
    color: 'red',
  },
  noData: {
    fontSize: '18px',
    color: '#555',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    backgroundColor: '#f3f3f3',
  },
  headerCell: {
    border: '1px solid #ccc',
    padding: '8px',
    backgroundColor: '#007BA7',
    color: '#ffffff',
    fontWeight: 'bold',
    textAlign: 'center',
  },
  cell: {
    border: '1px solid #ccc',
    padding: '8px',
    textAlign: 'center',
    color: '#333',
  },
};

export default RegistrationTable;
